export const getFetch = (id) => {

  return new Promise((resolve, reject) => {
    setTimeout(() => {
      if (id) {
        resolve(productos.find(producto => producto.id == id)) //retorna un objeto del array
      } else {
        resolve(productos)
      }
    }, 500)
  })
}

